description:
Jod:
- wspomaga prawidłowe działanie tarczycy;
- wspomaga prawidłowe funkcjonowanie układu nerwowego;
- wspomaga przemiany energetyczne w organizmie;
- pomaga zachować zdrową skórę;
- przyczynia się do prawidłowego wzrostu dzieci.

Jeden litr produktu zawiera 150 µg jodu, co stanowi 100% realizacji dziennej referencyjnej wartości spożycia dla osoby dorosłej. Nie należy przekraczać referencyjnej dziennej wartości spożycia.

Ważny jest zrównoważony sposób żywienia i zdrowy tryb życia. Jedna szklanka (250 ml) Ustronianki z jodem dziennie może powodować podane na opakowaniu korzyści dla naszego organizmu.

Magnez:
- przyczynia się do zmniejszenia uczucia zmęczenia i znużenia;
- pomaga w prawidłowym funkcjonowaniu układu nerwowego;
- pomaga w prawidłowym funkcjonowaniu mięśni;
- pomaga w utrzymaniu zdrowych kości, zębów.
Witamina B6:
- pomaga w prawidłowym funkcjonowaniu układu nerwowego;
- pomaga w utrzymaniu prawidłowych funkcji psychologicznych;
- pomaga w prawidłowej produkcji czerwonych krwinek;
- pomaga w prawidłowym funkcjonowaniu układu odpornościowego.
